            //console.log("value",self.dateModel);
            if (self.dateModel == null) {
                self.ngModel =null;
                self.ngModelCtrl.$setViewValue(self.ngModel);
            }else {
                date = moment(self.dateModel);
                self.ngModel = date.format("YYYY-MM-DD");
                self.ngModelCtrl.$setViewValue(self.ngModel);
            }
